#include <cstdio>
#include <cstring>
#include <string>
#include <vector>

using namespace std;

class Solution {

    vector<vector<int> > dp;
    string ss,tt;

public:
    int dfs(int a,int b) {
        if (dp[a][b] >= 0) {
            return dp[a][b];
        }
        if (b == tt.length()) {
            return dp[a][b] = 1;
        }
        if (a == ss.length()) {
            return dp[a][b] = 0;
        }
        int ret = 0;
        if (ss[a] == tt[b]) {
            ret += dfs(a+1,b+1);
        }
        ret += dfs(a+1,b);
        return dp[a][b] = ret;
    }

    int numDistinct(string s, string t) {
        dp.clear();
        dp.resize(s.length()+1);
        for (int i=0; i<=s.length(); i++) {
            for (int j=0; j<=t.length(); j++) {
                dp[i].push_back(-1);
            }
        }
        ss = s;
        tt = t;
        return dfs(0,0);
    }
};

int main () {
    Solution s;
    printf("%d\n",s.numDistinct("rabbbit","rabbit"));
    printf("%d\n",s.numDistinct("","a"));
    //printf("%d\n",s.numDistinct("", "rwmimatmhydhbujebqehjprarwfkoebcxxqfktayaaeheys"));
    return 0;
}
